  \"2016-07-27T22:58:10.508911\",\n\t\"name\": \"services-requests-for-additional-information-regarding-residual-risk-at-rocky-flats-nation\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is one of several important historical
  documents associated with remediation activities at the Rocky Flats National Wildlife
  Refuge. The U.S. Fish and Wildlife Service (Service) requested clarification related
  to its management actions associated with the Rocky Flats National Wildlife Refuge.
  The U.S. Environmental Protection Agency and Colorado Department of Public Health
  and Environment provided this important clarification in a letter (dated September
  21, 2011). Major Rocky Flats Site documents demonstrate and declare that the risks
  to the Wildlife Refuge Worker (WRW) and Wildlife Refuge Visitor (WRV) are within
  or below the acceptable CERCLA risk range and that radiation doses are below State
  standards. The lands comprising the Refuge are suitable for unlimted use and unrestricted
  exposure. In addition, this letter provides a new comparison of risk levels to plutonium
  soil concentrations on Refuge lands. The average plutonium concentration on Refuge
  lands is 1.09 pCi/g. This is magnitudes below the CERLCA risk range for the Refuge
  Worker and Refuge Visitor of 980 pCi/g (1x10-4) and 9.8 pCi/g (1x10-6).\",\n\t\"license_title\":
